The last piece we're missing is defining our toolchain cell block. We'll do this in /nix/example/toolchain.nix: # This cell block is less idiomatic and is geared towards customizing our
# standardized environment by making an overlayed version of the rust toolchain
# available to our cell. This is the benefit of having some flexibility with how
# we organize our cells and cell blocks.
{ inputs
, cell
}:
{ # `std` does not support global overlays, so we use `nixpkgs.extend` to make # a local overlay. # See: https://github.com/divnix/std/issues/117 rust = (inputs.nixpkgs.extend inputs.rust-overlay.overlays.default).rust-bin;
} A theme should start appearing now with the structure of cell blocks. In this case, we're given a little freedom with the structure of what it produces. The goal is to create an expression that evaluates to the latest stable version of the Rust toolchain using the rust-overlay flake we imported in our flake.nix. As the comments make note of, std discourages applying overlays globally and instead recommends defining a local instance of nixpkgs and using the extend function to apply overlays. This is exactly what we do here, with the result being we can access the Rust toolchain via rust.stable.latest.default.
